import './App.css';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';


function App() {
  return (
    <>
    <BrowserRouter>
    <Navbar/>
    <Router>
      <Route path='/'/>
    </Router>
    <Home/>

    </BrowserRouter>
    </>
  );
}

export default App;
